import classNames from 'classnames/bind';
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';

import styles from './Header.module.scss';
import images from '~/assets/images';
import { faClose, faPlus, faSearch } from '@fortawesome/free-solid-svg-icons';

const cx = classNames.bind(styles);

console.log(images.logo);

function Header() {
    return (
        <header>
            <div className={cx('wrapper')}>
                <div className={cx('inner')}>
                    <div className={cx('logo')}>
                        <img src={images.logo} alt="Forum " />
                        <h4 className={cx('')}>ForumLanguages</h4>
                    </div>

                    <div className={cx('search')}>
                        <input placeholder="Search posts with content..." />
                        <button className={cx('close')}>
                            <FontAwesomeIcon icon={faClose} />
                        </button>
                        <button>
                            <FontAwesomeIcon icon={faSearch} />
                        </button>
                    </div>

                    <div className={cx('action')}>
                        <button className={cx('create')}>
                            <FontAwesomeIcon icon={faPlus} />
                            <span>Create</span>
                        </button>
                        <button className={cx('notify')}>
                            
                        </button>
                        <button className={cx('login')}>{/* Login Post */}</button>
                        <button className={cx('register')}>{/* Register Post */}</button>
                    </div>
                </div>
            </div>
        </header>
    );
}

export default Header;
